import Link from 'next/link';

export default function Navbar() {
    const styles = {
        padding: '1rem'
    }

    return(
        <nav>
            <Link href='/'>
                <a>HOME PAGE</a>
            </Link>
            <Link href='/about'>
                <a>ABOUT PAGE</a>
            </Link>
            <Link href='/contact'>
                <a>CONTACT PAGE</a>
            </Link>
        </nav>
    );
}
